import React from 'react';

function MapContainer({selectedStations}){

    return(
        <div className="mapContainer" style={{ height: '45vw', width: '70%', backgroundColor: '#572759' }}>
            <h1>Start Station: {" "} {selectedStations[0] || "<placeholder>"}</h1> 
            <h1>End Station: {" "} {selectedStations[1] || "<placeholder>"}</h1>
            <img src={require('./img/mrtmap.png').default} style={{height: ''}}/>
        </div>
    );
}



export default MapContainer;
